sys_variable_value.value:
(function execute(inputs, outputs) {
    var parsedJSObj = JSON.parse(inputs.jsonobject);
    Object.keys(parsedJSObj).forEach(function(key, index) {
        if (parsedJSObj[key].toString().includes('https')) {
            parsedJSObj[key] = hyperLink(parsedJSObj[key]);
        }
    });

    outputs.output_json_object = normalizeJSON(parsedJSObj);
/*
*Make String as HyperLink for Journel Field
*/
    function hyperLink(link) {
        return '[code]<a href="' + link + '">' + link + '</a>[/code]';
    }
/*
*Normalize the JSON object
*/
    function normalizeJSON(parsedJSObj) {
        var level = 0;
        var myString = '';
        for (var name in parsedJSObj) {
            if (typeof parsedJSObj[name] == 'object') {
                myString += "\n" + " ".repeat(level * 4) + name + ": ";
                var stuff = parseLevel1(parsedJSObj[name], 1);
                myString += stuff;
            } else {
                myString += "\n" + " ".repeat(level * 4) + name + ": " + parsedJSObj[name];
            }
        }

        return myString;


    }
    function parseLevel1(obj, level) {
        var myString = '';
        for (var name in obj) {
            if (typeof obj[name] == 'object') {
                myString += "\n" + " ".repeat(level * 4) + name + ": ";
                var stuff = parseLevel2(obj[name], 2);
                myString += stuff;
            } else {
                myString += "\n" + " ".repeat(level * 4) + name + ": " + obj[name];
            }
        }
        return myString;
    }

    function parseLevel2(obj, level) {
        var myString = '';
        for (var name in obj) {
            if (typeof obj[name] == 'object') {
                myString += "\n" + " ".repeat(level * 4) + name + ": ";
                level = 3;
                var stuff = parseLevel3(obj[name], 3);
                myString += stuff;
            } else {
                myString += "\n" + " ".repeat(level * 4) + name + ": " + obj[name];
            }
        }
        return myString;
    }

    function parseLevel3(obj, level) {
        var str = '';
        for (var name in obj) {
            if (typeof obj[name] == 'object') {
                str += "\n" + " ".repeat(level * 4) + name + ": ";
                level = 3;
                var stuff = parseLevel4(obj[name], 4);
                str += stuff;
            } else {
                str += "\n" + " ".repeat(level * 4) + name + ": " + obj[name];
            }
        }
        return str;
    }

    function parseLevel4(obj, level) {
        var str = '';
        for (var name in obj) {
            str += "\n" + " ".repeat(level * 4) + name + ": " + obj[name];
        }
        return str;
    }


})(inputs, outputs);

